  CREATE OR REPLACE TRIGGER "ROOT"."ARES_SEQ_TRG" 
   before insert on "ROOT"."ARCHIVOESTADISTICO" 
   for each row 
begin  
   if inserting then 
      if :NEW."ARES_ID" is null then 
         select SEQ_ARES.nextval into :NEW."ARES_ID" from dual; 
      end if; 
   end if; 
  <<COLUMN_SEQUENCES>>
  BEGIN
    IF INSERTING AND :NEW.ARES_ID IS NULL THEN
      SELECT SEQ_ARES.NEXTVAL INTO :NEW.ARES_ID FROM SYS.DUAL;
    END IF;
  END COLUMN_SEQUENCES;
end;
/
ALTER TRIGGER "ROOT"."ARES_SEQ_TRG" ENABLE;
