--  DDL for Trigger ARES_FECHA_TRIGGER
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "ROOT"."ARES_FECHA_TRIGGER" 
BEFORE INSERT OR UPDATE of ARES_DATE ON ARCHIVOESTADISTICO
FOR EACH ROW
BEGIN
  
 :new.ARES_FECHA := REPLACE(TO_CHAR(:new.ARES_DATE, 'DD ,Month,YYYY','NLS_DATE_LANGUAGE = SPANISH'),' ,',' de ');
 DELETE FROM ULTIMAFECHA;
 INSERT INTO ULTIMAFECHA (ULFE_FECHA,ULFE_DIA)
 values (:new.ARES_DATE,REPLACE(TO_CHAR(:new.ARES_DATE, 'DD ,Month,YYYY','NLS_DATE_LANGUAGE = SPANISH'),' ,',' de '))
 ; 


END;
/
